        <footer className="bg-[#402E7A] text-white py-4 shadow-md max-w-4xl mx-auto flex items-center justify-center">
          <div className="mx-auto flex justify-center items-center gap-4 mt-2 text-center max-w-max h-full">
            <DarkModeToggle />
            <p className="text-lg">&copy; 2024 FizzBuzzBass. All Rights Reserved.</p>
          </div>
        </footer>
      );
};

export default Footer;
